How to filter and get required data from a nested document in MongoDB?<p>I have this structure in my DB.</p>
<pre class="lang-js prettyprint-override"><code>[
  {
    _id: ObjectId(&quot;6386ef039775398be3620c76&quot;),
    firstName: 'A',
    lastName: 'BA',
    age: 34,
    history: [
      { disease: 'fever', cured: true },
      { disease: 'malaria', cured: false }
    ]
  },
  {
    _id: ObjectId(&quot;6386ef239775398be3620c77&quot;),
    firstName: 'AA',
    lastName: 'BA',
    age: 24,
    history: [
      { disease: 'cold', cured: true },
      { disease: 'thyroid', cured: false }
    ]
  }
]
</code></pre>
<p>What i'm tying to achieve is a query which will get me data like this:</p>
<p>Query</p>
<pre class="lang-js prettyprint-override"><code> db.collection.find({$filter:{history:{$elemMatch:{cured:false}}}
</code></pre>
<p>Expected Result:</p>
<pre class="lang-js prettyprint-override"><code>[
  {
    _id: ObjectId(&quot;6386ef039775398be3620c76&quot;),
    firstName: 'A',
    lastName: 'BA',
    age: 34,
    history: [
      { disease: 'malaria', cured: false }
    ]
  },
  {
    _id: ObjectId(&quot;6386ef239775398be3620c77&quot;),
    firstName: 'AA',
    lastName: 'BA',
    age: 24,
    history: [
      { disease: 'thyroid', cured: false }
    ]
  }
]
</code></pre>
<p>What i have tried is</p>
<p>1.</p>
<pre class="lang-js prettyprint-override"><code>db.collection.find({$filter:{history:{$elemMatch:{cured:false}}}
</code></pre>
<ol start="2">
<li></li>
</ol>
<pre class="lang-js prettyprint-override"><code>  db.collection.aggregate([
    {
      $project: {
        history: {
          $filter: { 
           input: &quot;$history&quot;,
            as: &quot;items&quot;,
            cond: { cured: false } 
          },
        },
      },
    },
  ]);
</code></pre>
<ol start="3">
<li></li>
</ol>
<pre class="lang-js prettyprint-override"><code>db.collection.find({history:{$elemMatch:{cured:true}}},{'history.cured':1})
</code></pre>
<p>But none of these queries are giving desired result,</p>
<p>Doubts/ Questions:</p>
<ol>
<li>Is it possible to get expected result straight from a query?</li>
<li>Where my queries went wrong?</li>
<li>What material should i go through to cover more advance concepts related to this query?</li>
</ol>
<p>Any help would be much appreciated.
My apologies if this question is too basic.</p>

