Relate and Count Between Two Collections in MongoDB<p>How can I count the number of completed houses designed by a specific architect in MongoDB?
I have the next two collections, &quot;plans&quot; and &quot;houses&quot;.<br />
Where the only relationship between houses and plans is that houses have the id of a given plan.<br />
Is there a way to do this in MongoDB with just one query?</p>
<pre><code>plans
{
    _id: ObjectId(&quot;6388024d0dfd27246fb47a5f&quot;)
    &quot;hight&quot;: 10,
    &quot;arquitec&quot;: &quot;Aneesa Wade&quot;,
},
{
    _id: ObjectId(&quot;1188024d0dfd27246fb4711f&quot;)
    &quot;hight&quot;: 50,
    &quot;arquitec&quot;: &quot;Smith Stone&quot;,
}
houses
{
    _id: ObjectId
    &quot;plansId&quot;: &quot;6388024d0dfd27246fb47a5f&quot; -&gt; string,
    &quot;status&quot;: &quot;under construction&quot;,
},
{
    _id: ObjectId
    &quot;plansId&quot;: &quot;6388024d0dfd27246fb47a5f&quot; -&gt; string,
    &quot;status&quot;: &quot;completed&quot;,
}
</code></pre>
<p>What I tried was to use mongo aggregations while using $match and $lookup.<br />
The &quot;idea&quot; with clear errors would be something like this.</p>
<pre><code>db.houses.aggregate([
    {&quot;$match&quot;: {&quot;status&quot;: &quot;completed&quot;}},
    {
        &quot;$lookup&quot;: {
            &quot;from&quot;: &quot;plans&quot;,
            &quot;pipeline&quot;: [
                { 
                    &quot;$match&quot;: { 
                        &quot;$expr&quot;: { 
                            &quot;$and&quot;: [
                                { &quot;$eq&quot;: [ &quot;houses.plansId&quot;, { &quot;$toString&quot;: &quot;$plans._id&quot; }]},
                                { &quot;plans.arquitec&quot; : &quot;Smith Stone&quot; },                                
                            ]
                        } 
                    } 
                },
            ],
        }
    }
</code></pre>

