embedfield:
How to search a Mongo collection for a document that contains an array that contains an element that meets a particular criteria?<p>I'm new at Mongo and there might be a better way to do what I want.  I'm dealing with a particular data structure that my application must process.</p>
<p>Suppose that I have a collection that contains two documents that contain information about universities and their student clubs to include the name of each club and the name of each student in each club along with their age:</p>
<pre><code>{
    _id: 1, // object ID
    name: &quot;Oxford University&quot;,
    clubs: [{
        name: &quot;Soccer&quot;,
        members: [{
                name: &quot;Alice&quot;,
                age: 22
            },
            {
                name: &quot;Bob&quot;,
                age: 23
            }
        ]
    }, {
        name: &quot;Gymnastics&quot;,
        members: [{
                name: &quot;Charlie&quot;,
                age: 20
            },
            {
                name: &quot;Dorothy&quot;,
                age: 19
            }
        ]
    }]
}

{
    _id: 2, // object ID
    name: &quot;Cambridge University&quot;,
    clubs: [{
        name: &quot;Chess&quot;,
        members: [{
                name: &quot;Ellen&quot;,
                age: 30
            },
            {
                name: &quot;Frank&quot;,
                age: 35
            }
        ]
    }, {
        name: &quot;Go&quot;,
        members: [{
                name: &quot;Gilbert&quot;,
                age: 25
            },
            {
                name: &quot;Hikari&quot;,
                age: 40
            }
        ]
    }]
}
</code></pre>
<p>Suppose that I want to write a query on this collection that will find universities that have a club that has at least one member aged 40 or older.</p>
<p>How do I do that?</p>
<p>I sketched this example based off of the idea of taking some JSON documents and inserting them into a new collection.  Maybe it would be a better idea to break this apart into multiple collections.  I just had the idea to research if Mongo might be a good product to use in this situation given that a big part of my job here is to create something that can receive some JSON data, process it, and make it queryable.</p>

